import React, { Component } from 'react';
import Header from './components/Header.js';
import Footer from './components/Footer.js';
import $ from 'jquery';
import './App.css';

// import Swiper core and required components
import SwiperCore, { Navigation, Pagination, Scrollbar, A11y } from 'swiper';

import { Swiper, SwiperSlide } from 'swiper/react';

// Import Swiper styles
import 'swiper/swiper.scss';
import 'swiper/components/navigation/navigation.scss';
import 'swiper/components/pagination/pagination.scss';
import 'swiper/components/scrollbar/scrollbar.scss';

class App extends Component {
  constructor(props) {
    super(props);
  }
  componentDidMount(){

  }
  render(){
    return (
      <main>
        <Header/>

        <section id="cover" className="pt0">
          <div className="bg-blue pa4 w-80 center">
            <h2 className="tc">別以為糖尿病只是尿尿比較甜而已<br/>它也會攻擊腎臟和心臟</h2>
            <h5 className="tc">糖尿病殺手</h5>
            <div>開始</div>
          </div>
        </section>

        <section id="car">
          <div className="mw9 center ph3-l">
            <div className="cf ph2-l">
              <div className="fl w-100 w-50-l pa2">
                <div className="bg-white pv4"></div>
              </div>
              <div className="fl w-100 w-50-l pa2">
                <div className="bg-white pv4"></div>
              </div>
            </div>
            <div className="cf ph2-l">
              <div className="fl w-100 w-50-l pa2">
                <div className="bg-white pv4"></div>
              </div>
              <div className="fl w-100 w-50-l pa2">
                <div className="bg-white pv4"></div>
              </div>
            </div>
          </div>
        </section>
        <section id="how">
          <h2 className="title">如何影響糖尿病友</h2>
        </section>
        <section id="cause">
          <h2 className="title">十大死因</h2>
        </section>
        <section id="knowledge">
          <h2 className="title">知己知彼</h2>
        </section>
        <section id="factor">
          <h2 className="title">你有這些</h2>
        </section>
        <section id="qa">
          <h2 className="title">常見 Q&A</h2>
        </section>
        <section id="map">
          <h2 className="title">要怎麼找到</h2>
        </section>
        <section id="banner">
          <h3 className="tc">如果有飲食</h3>
        </section>
        <Footer/>
      </main>
    )
  }
}

export default App;
